PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "views" (
    "id" INTEGER,
    "print_number" INTEGER,
    "english_title" TEXT,
    "japanese_title" TEXT,
    "artist" TEXT,
    "average_color" TEXT,
    "brightness" NUMERIC,
    "contrast" NUMERIC,
    "entropy" NUMERIC,
    PRIMARY KEY("id")
);
COMMIT;
